import React from 'react';
import { Container } from 'semantic-ui-react'
import logo from '../../img/logo-profite.svg';

const Header = props => {
    return (
        <header>
            <Container>
                <img src={logo} alt="logo"/>
            </Container>
        </header>
    )
}

export default Header;
